import React, { useState } from 'react';

function CropPredictionForm() {
  const [phValue, setPhValue] = useState('');
  const [nitrogenValue, setNitrogenValue] = useState('');
  const [phosphorusValue, setPhosphorusValue] = useState('');
  const [potassiumValue, setPotassiumValue] = useState('');
  const [hydrationValue, setHydrationValue] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    // Implement your crop prediction logic here and display the result.
  };

  return (
    <div className="container mx-auto mt-8">
      <h2 className="text-2xl font-semibold mb-4">Crop Prediction</h2>
      <form onSubmit={handleSubmit}>
        <div className="mb-4">
          <label htmlFor="phValue">pH Value:</label>
          <input
            type="number"
            id="phValue"
            value={phValue}
            onChange={(e) => setPhValue(e.target.value)}
            required
          />
        </div>
        <div className="mb-4">
          <label htmlFor="nitrogenValue">Nitrogen Value:</label>
          <input
            type="number"
            id="nitrogenValue"
            value={nitrogenValue}
            onChange={(e) => setNitrogenValue(e.target.value)}
            required
          />
        </div>
        <div className="mb-4">
          <label htmlFor="phosphorusValue">Phosphorus Value:</label>
          <input
            type="number"
            id="phosphorusValue"
            value={phosphorusValue}
            onChange={(e) => setPhosphorusValue(e.target.value)}
            required
          />
        </div>
        <div className="mb-4">
          <label htmlFor="potassiumValue">Potassium Value:</label>
          <input
            type="number"
            id="potassiumValue"
            value={potassiumValue}
            onChange={(e) => setPotassiumValue(e.target.value)}
            required
          />
        </div>
        <div className="mb-4">
          <label htmlFor="hydrationValue">Hydration Value:</label>
          <input
            type="number"
            id="hydrationValue"
            value={hydrationValue}
            onChange={(e) => setHydrationValue(e.target.value)}
            required
          />
        </div>
        <button type="submit" className="bg-blue-500 text-white p-2 rounded">
          Predict Crop
        </button>
      </form>
    </div>
  );
}

export default CropPredictionForm;
